import React, {FC} from 'react';
import {ISpace} from "@entities/space";
import {userStore} from "@entities/user";
import {NavLink} from "react-router-dom";
import {ROUTER_URL} from "@shared/config";

type SpaceProps = {
    data: ISpace;
};

export const Space: FC<SpaceProps> = (props) => {
    const {data} = props;

    const profile = userStore.useProfile()!;

    console.log(data.avatar);

    return (
        <div>
            <img
                src={data.avatar.replace("localhost", "localhost:7000")}
            />
            <div>
                <p>{data.name}</p>
                {
                    data.admin.id === profile.user.id && (
                        <p><i>Вы являетесь администратором</i></p>
                    )
                }
            </div>
            
            <NavLink to={ROUTER_URL.SPACES.TASK(data.id)} />
        </div>
    );
};
